import React, { Component } from 'react';
import axios from 'axios';
import BlogList from './BlogList';

class Blog extends Component{
    state = {"listData" : [{
        "title" : "test" ,
        "contents" : "test",
        "create_date" : "2019-06-10"
    }]
    }
    constructor(props){
        super(props);
        let listData = axios.get("http://localhost:8080/").then(response => {
            console.log(response);
            console.log(response.data.rows[0]);
        }).catch(response => {
            console.log(response);
        })
        this.setState({
            listData : listData
        })
        console.log("data : ");
        console.log(this.state.listData);
    }

    handleClick = () => {
        console.log("click!")
    }

    render() {
        return (
            <div>
                <BlogList onClick={this.handleClick}
                        info={this.listData}/>
            </div>
        )
    }
}

export default Blog;
